import { createIcon } from "../icon/createIcon";

export const PlaySolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="PlaySolidIcon">
    <path d="m2 1 9 5-9 5z" />
  </svg>,
  "PlaySolid",
  "play solid"
);
